import React from "react";
import { connect } from "react-redux";

const InternalPopularTages = props => {
  const tempTagList = [];

const ListCounter = (arr) =>{
    arr.reduce((all, element)=> {
      if (element in all) {
        all[element]++;
      } else {
        all[element] = 1;
      }
      return all;
    }, {});
  }


  return (
    <div class='col-md-3'>
      <div class='sidebar'>
        <p>Popular Tags</p>

        <div class='tag-list'>
          {props.articleLibrary &&
            props.articleLibrary.forEach(article => {
              if (article.tagList.length !== 0) {
                article.tagList.forEach(item => {
                  tempTagList.push(item);
                });
              }
              console.log(ListCounter(tempTagList));
              // 新数组统计元素个数
            })}
          <a href='#top' class='tag-pill tag-default'>
            programming
          </a>
          <a href='#top' class='tag-pill tag-default'>
            programming
          </a>
        </div>
      </div>
    </div>
  );
};

const mapStateToProps = state => {
  return { ...state };
};

const mapDismatchToProps = dispatch => {
  return {};
};

export const PopularTages = connect(
  mapStateToProps,
  mapDismatchToProps
)(InternalPopularTages);
